INSERT INTO `crm_product` VALUES (1259732082293858305, 1258330882213699586, '2020-05-11 14:28:28', 1258330882213699586, '2020-05-11 17:27:10', 0, '室内高清小间距', '000001', '套', 10000.00, '<p><span style=\"color: rgb(51, 51, 51);\">超高清显示屏产品，具有完美细腻的显示效果，同时拥有“零”边框设计，完美替代液晶拼接，DLP、LCD显示屏</span></p><p><span style=\"color: rgb(51, 51, 51);\">√ 低亮高灰高刷</span></p><p><span style=\"color: rgb(51, 51, 51);\">√ 无缝拼接设计、外观时尚简约</span></p><p><span style=\"color: rgb(51, 51, 51);\">√ 画面细腻清晰</span></p><p><span style=\"color: rgb(51, 51, 51);\">√ 节能环保、功耗较传统箱体节省15%</span></p><p><span style=\"color: rgb(51, 51, 51);\">√ 宽视角技术，细节完美体现</span></p><p><span style=\"color: rgb(51, 51, 51);\">√ 300-800宽范围亮度可调</span></p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/2016516154936987.jpg\"></p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/2016525104851708.jpg\"></p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/2016525104834818.jpg\"></p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/201652510498438.jpg\"></p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/2016525104924947.jpg\"></p>', 1259725559698087937, 'LED电子显示屏', 1, 1260837890204889089, 'CRM演示');
INSERT INTO `crm_product` VALUES (1259732930398904321, 1258330882213699586, '2020-05-11 14:31:50', 1258330882213699586, '2020-05-11 14:31:50', 0, '室内标准产品系列', '000002', '套', 15000.00, '<p>最新显示屏产品，拥有完美的显示效果及精美的产品外观，安装快捷方便，适合室内使用</p><p>√ 垂直竖排灯技术，左右观看不褪色</p><p>√ 图像无鬼影</p><p>√ 产品任意拆卸，方便维护</p><p>√ 模组接口型号/电源双备份</p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/2016516155523441.jpg\"></p><p><img src=\"http://www.cntv110.com/images/al5.jpg\"></p><p><img src=\"http://www.cntv110.com/images/al6.jpg\"></p>', 1259725559698087937, 'LED电子显示屏', 1, 1260837890204889089, 'CRM演示');
