INSERT INTO `crm_product` VALUES (1259734504420532226, 1258330882213699586, '2020-05-11 14:38:05', 1258330882213699586, '2020-05-11 14:38:05', 0, '户外标准产品系列', '000004', '套', 12000.00, '<p>常规户外产品系列，拥有多种规格及防护等级，满足户外不同场合安装使用</p><p>√ Ip65防护等级，满足户外环境使用</p><p>√ 超高亮、低衰减</p><p>√ 灯驱合一机构、散热良好</p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/2016516155310897.jpg\"></p><p><br></p><p><strong>工程效果</strong></p><p><br></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/2016525122624481.jpg\"></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/2016525122634589.jpg\"></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/2016525122647463.jpg\"></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/2016525122715981.jpg\"></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/2016525122724122.jpg\"></p>', 1259725559698087937, 'LED电子显示屏', 1, 1260837890204889089, 'CRM演示');
INSERT INTO `crm_product` VALUES (1259735014296903681, 1258330882213699586, '2020-05-11 14:40:07', 1258330882213699586, '2020-05-11 14:40:07', 0, '室内外单双色', '000005', '套', 5000.00, '<p><strong style=\"color: rgb(51, 51, 51);\">产品特点：</strong></p><p><span style=\"color: rgb(51, 51, 51);\">单基色显示屏:可显示单红色文字双基色显示屏：可显示红、绿、黄三色文字图案</span></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">使用场所：</strong></p><p><span style=\"color: rgb(51, 51, 51);\">室外显示屏：面积一般几十平方米至几百平方米，亮度高，可在阳光下工作，具有防风、防雨、防水功能。&nbsp;</span></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">产品规格参数：</strong></p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/201651615578947.jpg\"></p><p><br></p><p><strong style=\"color: rgb(51, 51, 51);\">工程效果：</strong></p><p><br></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/2016525125941190.jpg\"></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/2016525125958588.jpg\"></p><p><img src=\"http://www.cntv110.com/Manager/edit/UploadFile/201652513020367.jpg\"></p>', 1259725559698087937, 'LED电子显示屏', 1, 1260837890204889089, 'CRM演示');
INSERT INTO `crm_product` VALUES (1259736287695986690, 1258330882213699586, '2020-05-11 14:45:10', 1258330882213699586, '2020-05-11 14:52:57', 0, 'LED照明化系统', '100001', '套', 8890.00, '<p>LED照明亮化系统是指采用人造照明系统以满足特定光环境中照明要求的设计技术及工程。照明的要求主要是被照表面的光照度、亮度、显色性及光环境的视觉效果等。照明的光环境包括室内及道路、广场等室外空间。现代照明还包括城市夜景工程等。</p><p>照明工程的内容还包括光源、灯具及控制系统的研究和制造，光度和色度的测量及视觉评价等。特别是现代照明学的基本理论，光的度量，电光源、照明灯具，照明的规程与标准，以及对各种光源和照明技术的定性分析和基本的定量计算等。</p><p>照明工程包括照明亮化,夜景照明,城市亮化、城市建筑照明,市政道路照明、楼宇亮化,楼宇照明等工程。是一个概括的活法。照明工程工作程序一般是：照明工程设计师通过照明、亮化设计，技术人员进行照明工程安装、调试、验收等一些列活动。照明工程既有照明作用，更有美化城市环境的作用。随着社会科技发展，LED在照明工程中的应用越来越普及。其节能、高亮度、色彩美观等超值性能使得LED在照明工程中广泛应用。北京世纪澄通电子有限公司LED照明亮化系统借助最新的LED照明技术，减少能源消耗，降低废气排放，提高城市灯光亮度的节能减排。</p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/201471072857202.jpg\"></p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/20147107299899.jpg\"></p>', 1259725560973156354, 'LED照明亮化系统', 1, 1260837890204889089, 'CRM演示');
INSERT INTO `crm_product` VALUES (1259738172469403650, 1258330882213699586, '2020-05-11 14:52:40', 1258330882213699586, '2020-05-11 14:52:40', 0, 'LED无缝大屏幕拼接', '200001', '套', 9000.00, '<p><img src=\"http://www.cntv110.com/images/al3.jpg\"></p><p><img src=\"http://www.cntv110.com/images/al4.jpg\"></p><p><img src=\"http://www.cntv110.com/images/pro4.jpg\"></p><p><img src=\"http://www.cntv110.com/images/pro5.jpg\"></p><p><img src=\"http://www.cntv110.com/images/pro6.jpg\"></p>', 1259725561958817794, 'LED无缝大屏幕拼接', 1, 1260837890204889089, 'CRM演示');
INSERT INTO `crm_product` VALUES (1259738616918827010, 1258330882213699586, '2020-05-11 14:54:26', 1258330882213699586, '2020-05-11 14:54:26', 0, '生产管理看板', '300001', '套', 5000.00, '<p><strong style=\"color: rgb(14, 88, 168);\">专业定制各行业特殊用屏</strong></p><p>LED电子看板、生产管理看板、仓储管理看板、一体化生产线产量屏、生产线故障显示报警屏</p><p><br></p><p><strong style=\"color: rgb(14, 88, 168);\">液晶电子看板系统</strong>&nbsp;</p><p>新一代液晶显示生产线看板(电子看板)是专门为生产型企业设计的生产电子看板管理系统，</p><p>特色之一：在成本较低的情况下就可以实现传统LED的所有显示内容（包括数据实时更新）</p><p>特色之二：显示精细，刷新更快。可满足图形显示的需要。</p><p><img src=\"http://www.cntv110.com/manager/edit/UploadFile/201471071215910.jpg\"></p><p><strong style=\"color: rgb(14, 88, 168);\">LED电子看板系统</strong></p><p><span style=\"color: rgb(51, 51, 51);\">系统特点</span></p><p><span style=\"color: rgb(51, 51, 51);\">（1）输入设备采用红外线遥控器(或键盘)或PC机等设备。</span></p><p><span style=\"color: rgb(51, 51, 51);\">（2）输入设备采用个人计算机时，配置相应软件，它提供与显示屏完全对应的操作界面。</span></p><p><span style=\"color: rgb(51, 51, 51);\">（3）可以同时在多个显示屏上分别编辑显示屏的数据，确定编辑完成后,系统自动把各个显示屏输入编辑的数据在多个显示屏显示。</span></p><p><span style=\"color: rgb(51, 51, 51);\">（4）具有实时时间和日期显示。&nbsp;</span></p><p><span style=\"color: rgb(51, 51, 51);\">（5）每日生产信息每隔一段时间翻屏显示，可显示多种不同的产品信息内容。</span></p><p><span style=\"color: rgb(51, 51, 51);\">（6）显示屏管理系统对显示屏的每日生产信息及当前产品特定时间段的信息采集处理并显示在显示屏上。</span></p><p><span style=\"color: rgb(51, 51, 51);\">（7）显示屏通过自动检测器信号自动更新生产信息。</span></p><p><span style=\"color: rgb(51, 51, 51);\"><span class=\"ql-cursor\">﻿</span></span><img src=\"http://www.cntv110.com/manager/edit/UploadFile/201471071227662.jpg\"></p>', 1259725562940284929, '生产管理看板', 1, 1260837890204889089, 'CRM演示');
