INSERT INTO `shop_goods` VALUES (1255063005683527681, NULL, 1244558890939486210, 1244555113624801281, 0, 0, '0001', 0, 1, 0, 0, 0, 1, 1, '甬江鱼塘', '甬江鱼塘欢迎您', '', 100.00, 100.00, '', 0, '', 1, 0, 0, 'http://xquick-pub.oss-cn-hangzhou.aliyuncs.com/oss/20200429/8fc9bbdde8df451e80869a38e22b52f7.jpg,http://xquick-pub.oss-cn-hangzhou.aliyuncs.com/oss/20200429/6aba9adb068d485a8752bbb06c935bfc.jpg,http://xquick-pub.oss-cn-hangzhou.aliyuncs.com/oss/20200429/f44ae3b7c55a41758e64aa4833fd0896.jpg,http://xquick-pub.oss-cn-hangzhou.aliyuncs.com/oss/20200429/ec54b8c7de094ff2aa6ec2771f75942f.jpg', '<p><br></p><p>甬江鱼塘位于浙江省宁波市姜山镇朝阳路王家附近（地铁3号线明辉路站往北100米），钓场面积30亩，有青鱼、草鱼、鲫鱼、白条等混养。水深3米，交通便利、环境优美，随到随钓，是休闲娱乐的好地方。</p><p><br></p><p><strong>费用包含</strong></p><p>1.一份简餐</p><p>2.3斤鱼</p><p>3.超出3斤部分按每斤25元额外付费。</p><p><br></p><p><strong>入钓场须知:</strong></p><p>营业时间: 7:00～21:00&nbsp;</p><p>地点: 浙江省宁波市姜山镇朝阳路王家附近（地铁3号线明辉路站往北100米）</p><p>入钓场方式:</p><p>1. 凭下单时预留的手机号码短信验证码；</p><p>有效期限:（有效期内可入园1次） 1天内有效&nbsp;</p><p><br></p><p><br></p>', NULL, -1.00, -1.00, 0, 58.00, 0.0000, 0.00, NULL, 0.00, 0, 1262568389432328194, '2020-04-28 17:15:13', 1118075560757063682, '2020-06-02 15:39:27', 0, 1244554469220323331, '甬江鱼塘', NULL, NULL, 0);
INSERT INTO `shop_goods` VALUES (1257553709808635905, NULL, 1250344994846928897, 1244554644156354562, 0, 0, '1001', 1, 1, 0, 0, 0, 1, 1, '毛玉', '毛玉标题', '', 999.00, 0.01, '[]', 0, '', 1, 0, 0, 'http://xquick-pub.oss-cn-hangzhou.aliyuncs.com/oss/20200505/828ef5f098f3408ea30f4943be81f8f0.jpg', '<p>毛玉&nbsp;（东方Project里面的杂兵）&nbsp;<span style=\"background-color: rgb(255, 255, 255); color: rgb(102, 102, 102);\">编辑</span>&nbsp;<a href=\"https://baike.baidu.com/planet/talk?lemmaId=12003570\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(102, 102, 102);\">讨论</a>&nbsp;<span style=\"background-color: rgb(255, 255, 255); color: rgb(102, 102, 102);\">上传视频</span></p><p>动漫游戏<a href=\"https://baike.baidu.com/item/%E4%B8%9C%E6%96%B9Project\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">东方Project</a>中的妖怪，从外表上看，毛玉通常为一只直径5cm至20cm的<a href=\"https://baike.baidu.com/item/%E6%AF%9B%E7%90%83/8853380\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">毛球</a>，看不到眼睛和嘴巴等器官。</p><p>毛玉是个彻彻底底的杂兵，但却有不低的人气，除了被赋予面部表情之外，也出现了拟人化/娘化<a href=\"https://baike.baidu.com/item/%E7%89%88\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">版</a>本。</p><p>毛玉种族也有着多种不同的种类，不同毛玉在形态、能力上也有所不同。</p>', NULL, -1.00, -1.00, 1, 104.00, 0.0000, 5.00, NULL, 1.00, 0, 1262568389432328194, '2020-05-05 14:12:23', 1262568389432328194, '2020-05-19 15:58:57', 0, 1262205195325661186, '商城演示', NULL, NULL, 0);
