-- ----------------------------
-- Table structure for pay_order
-- ----------------------------
DROP TABLE IF EXISTS `pay_order`;
CREATE TABLE `pay_order`  (
  `id` bigint(20) NOT NULL COMMENT 'id',
  `channel_id` bigint(20) NOT NULL COMMENT '渠道id',
  `channel_param` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '渠道支付参数',
  `transaction_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付订单号',
  `currency` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '三位货币代码,人民币:cny',
  `notify_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '通知地址',
  `notify_count` tinyint(6) NOT NULL DEFAULT 0 COMMENT '通知次数',
  `pay_type` tinyint(3) NULL DEFAULT NULL COMMENT '支付类型',
  `order_table` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单表名,如shop_order',
  `order_id` bigint(20) NOT NULL COMMENT '订单id',
  `order_no` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '订单号',
  `total_fee` int(10) NULL DEFAULT NULL COMMENT '订单金额',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '支付完成时间',
  `status` tinyint(3) NOT NULL DEFAULT 1 COMMENT '支付状态,0-订单生成,1-支付中(目前未使用),2-支付成功,3-业务处理完成',
  `create_id` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建者',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_id` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT 0 COMMENT '删除标记',
  `tenant_id` bigint(20) NOT NULL COMMENT '租户id',
  `tenant_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '租户名称',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `ux_transaction_id`(`transaction_id`) USING BTREE,
  INDEX `idx_user`(`channel_id`, `status`, `deleted`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '支付订单' ROW_FORMAT = Dynamic;

