  `sn` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '编号',
  `delivery` tinyint(1) NOT NULL COMMENT '是否需要物流',
  `marketable` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否上架',
  `limit_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '限购方式0不限购 1 永久限购 2 按天限购 3 按周限购 4 按月限购 5 按年限购',
  `limit_count` int(11) NULL DEFAULT NULL COMMENT '限购数量',
  `member_discount` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '参与会员折扣 0 不参与 1参与',
  `top` tinyint(1) NOT NULL COMMENT '是否置顶',
  `type` tinyint(3) NOT NULL COMMENT '类型 1 商品 2 积分兑换 3 赠品',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '名称',
  `title` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标题',
  `tags` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标签,逗号分隔',
  `market_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '市场价',
  `sale_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '售价',
  `attrs` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '属性,不会影响价格、数量等业务',
  `spec_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '规格类型 0 单规格 1 多规格',
  `specs` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '规格,与sku关联',
  `status` tinyint(3) NOT NULL DEFAULT 1 COMMENT '状态',
  `pay_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '支付状态 0 待支付 1已支付 -1已退款',
  `hits` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '点击数',
  `imgs` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '图片',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '图文内容',
  `score` float NULL DEFAULT NULL COMMENT '评分',
  `qty_min` decimal(10, 2) NOT NULL DEFAULT -1.00 COMMENT '单次下单最小值-1不限制',
  `qty_max` decimal(10, 2) NOT NULL DEFAULT -1.00 COMMENT '单次下单最大值-1不限制',
  `cartable` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否可以加入购物车',
  `stock` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '库存',
  `dist_scale` decimal(6, 4) NULL DEFAULT NULL COMMENT '分销提成比例',
  `dist_max_val` decimal(10, 2) NULL DEFAULT NULL COMMENT '分销提成最大值',
  `dist_val` decimal(10, 2) NULL DEFAULT NULL COMMENT '分销提成值',
  `dist_min_val` decimal(10, 2) NULL DEFAULT NULL COMMENT '分销提成最小值',
  `dist_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '分销类型0 无分销 1 按比例提成 2 固定金额提成 3 随机数提成',
  `create_id` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建者',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_id` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT 0 COMMENT '删除标记',
  `tenant_id` bigint(20) NOT NULL COMMENT '租户id',
  `tenant_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '租户名称',
  `valid_start_time` datetime(0) NULL DEFAULT NULL COMMENT '商品有效期起始',
  `valid_end_time` datetime(0) NULL DEFAULT NULL COMMENT '商品有效期结束',
  `sales_volume` int(11) NULL DEFAULT 0 COMMENT '销量',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品spu' ROW_FORMAT = Dynamic;

