-- ----------------------------
-- Table structure for shop_order
-- ----------------------------
DROP TABLE IF EXISTS `shop_order`;
CREATE TABLE `shop_order`  (
  `id` bigint(20) NOT NULL COMMENT 'id',
  `status` tinyint(3) NOT NULL COMMENT '状态 0：待付款  1：待发货  2:待收货  3：待评价  -1：退款   -2：售后',
  `pay_status` tinyint(3) NOT NULL COMMENT '支付状态 0 待支付 1已支付 -1已退款',
  `no` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0.0' COMMENT '订单号',
  `create_id` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '创建者',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_id` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `tenant_id` bigint(20) NOT NULL COMMENT '租户id',
  `tenant_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '租户名称',
  `deleted` tinyint(1) NOT NULL DEFAULT 0 COMMENT '删除标记',
  `user_id` bigint(20) NOT NULL COMMENT '买方用户id',
  `sell_user_id` bigint(20) NULL DEFAULT NULL COMMENT '卖方用户id',
  `benefit_user_id` bigint(20) NULL DEFAULT NULL COMMENT '收益用户id',
  `benefit_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '收益金额',
  `benefit_status` tinyint(3) NULL DEFAULT NULL COMMENT '收益状态 0 未发放 1 已发放 -1 已回收',
  `user_remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用户备注',
  `goods_detail` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品详情,简略商品信息',
  `goods_price` decimal(10, 2) NOT NULL COMMENT '商品费用',
  `express_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '物流费用',
  `goods_discount_price` decimal(10, 2) NOT NULL COMMENT '商品折扣费用',
  `total_price` decimal(10, 2) NOT NULL COMMENT '订单总费用',
  `points_deduct` int(10) NOT NULL DEFAULT 0 COMMENT '积分抵扣',
  `point_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '积分抵扣金额',
  `pay_price` decimal(10, 2) NOT NULL COMMENT '支付费用',
  `pay_type` tinyint(3) NOT NULL COMMENT '支付类型 0 无须支付 1 现金交易 2 银行转账 3 支付宝支付 4 微信支付 5 账户余额支付',
  `order_time` datetime(0) NOT NULL COMMENT '下单时间',
  `pay_transaction_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付交易ID',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '付款时间',
  `deliver_time` datetime(0) NULL DEFAULT NULL COMMENT '发货时间',
  `express_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流单号',
  `express_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流类型',
  `receiver_id` bigint(20) NULL DEFAULT NULL COMMENT '收货地址id',
  `receiver_consignee` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收件人',
  `receiver_mobile` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收件人电话',
  `receiver_address` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收件详细地址',
  `receiver_region_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收件地址区域编码',
  `receiver_region_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收件地址区域',
  `receiver_region_lat` double(10, 6) NULL DEFAULT NULL COMMENT '收件地址纬度',
  `receiver_region_lng` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收件地址经度',
  `buy_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '购买方式',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单' ROW_FORMAT = Dynamic;

